const e=JSON.parse('{"key":"v-184f4da6","path":"/intro.html","title":"关于组织","lang":"zh-CN","frontmatter":{"icon":"info","title":"关于组织","author":"高木Github组织","article":false,"cover":"https://pic.imgdb.cn/item/648568de1ddac507cc66bd56.webp"},"headers":[],"git":{"createdTime":1691564614000,"updatedTime":1691564614000,"contributors":[{"name":"一只鬆","email":"yzsong06@outlook.com","commits":1}]},"readingTime":{"minutes":1.16,"words":347},"filePathRelative":"intro.md","localizedDate":"2023年8月9日","excerpt":"<h1> 简介</h1>\\n<p>这个Github组织的建立，最开始是因为当时正在建设的类wiki站点-<a href=\\"https://wiki.takagi3.cn\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">高木同学自建信息站</a>，处于同一个组织下会相对方便些（而不是多个人账号互相去协调）。</p>\\n<p>不过因为就那么几个人来做，内容建设进度很慢。想着开源也无妨，万一有热心朋友帮忙呢，所以后面在别的朋友的提议下就创建了这个Github组织作为整合，原来的名字是\\"TakagiWikiSitesCN\\"。</p>\\n<p>后来在Github翻了翻，发现跟高木同学有关的内容仓库其实还有好几个，有些还是在各种群聊里见过名字的人，就想着要不整一个大开放的，跟高木有关的都可以往里整合，进而组成一个“特色内容”的Repo组织，于是又改了名字：\\"TakagisanArchiveRepos\\"。</p>"}');export{e as data};
